// SPDX-License-Identifier: MIT
pragma solidity ^0.8.16;

// storage layout
// https://docs.soliditylang.org/en/v0.8.10/internals/layout_in_storage.html
// https://docs.soliditylang.org/en/v0.8.10/internals/layout_in_memory.html

contract GasStorageTest {

	uint128 _uint128;
	uint256 _uint256;

	uint128[16] _uint128_array;
	uint256[8] _uint256_array;

	bytes16 _bytes16;
	bytes32 _bytes32;

	constructor() {
		// _uint128 = 1;
		// _uint256 = 2;
	}

	function dummy() public {
	}

	function store_uint128() public {
		_uint128 = 111;
	}
	function store_uint256() public {
		_uint256 = 111;
	}
	function store_uint256_keccak256() public {
		_uint256 = uint256(keccak256('store_uint256_keccak256'));
	}

	function store_uint128_twice() public {
		_uint128 = 222;
		_uint128 = 333;
	}
	function store_uint256_twice() public {
		_uint256 = 222;
		_uint256 = 333;
	}
	function store_bytes16() public {
		_bytes16 = '01234567890ABCDE';
	}
	function store_bytes32() public {
		_bytes32 = '01234567890ABCDE01234567890ABCDE';
	}


	function store_uint128_array() public {
		for(uint128 i = 0 ; i < _uint128_array.length ; ++i) {
			_uint128_array[i] = 1000*(i+1);
		}
	}
	function store_uint256_array() public {
		for(uint256 i = 0 ; i < _uint256_array.length ; ++i) {
			// _uint256_array[i] = 1000*(i+1);
			_uint256_array[i] = uint256(keccak256('store_uint256_array'));
		}
	}


}
